text:
【on this beautiful fall day】i was in a local convenience store in the morning, footing my bill and noticed this man, also at the counter, who stood unnecessarily close behind my back. i moved. he inched closer. as i was exiting the store, he followed my steps pretty closely. "this man could be a pervert," i thought to myself. then something more off-putting happened: i tried to push open the door and he had to hover closely behind my back, hand also on the door. i walked out, again he followed closely behind. i finally turned and gave him a disdainful look. thank god, he backed off. //
//
some forms of being disrespectful towards women are much more subtle; still sickening and valid even if they're not sexual assaults. have i not read articles about how some men draw close to women to “simply sniff”, or have i not had traveled solo extensively enough to be more alert, i could have simply dismissed the situation as a very “odd” one. so if you are a man reading this, i hope you know,  showing respect to women is pretty manly. //
//
(p/s: i wished i had turned earlier to let him know it's unacceptable. i also wished i’d control my fart so i could let the smelliest one out in the face of that rude man. 💨🙄) 💃🏻

